        public static void SeedData(IMongoCollection<User> userCollection)
        {
            bool existsUsers = userCollection.Find(p => true).Any();
            if (!existsUsers)
            {
                userCollection.InsertManyAsync(GetPreconfiguredUsers());
            }
        }

